    */


    main_window->Plot();


#endif

#ifdef QTGRAPHICS
    if (batch) {
      //main_window->toggleMovieFrames();
      //main_window->toggleShowNodes();
      //for (int i=0;i<par.nit;i++) {
      double t=0.;
      do {
	t = main_window->TimeStep();
		  /* cerr << endl << "***********************************************" << endl;
